description:
Cast Allie Haze,Anikka Albrite,Asa Akira,Britney Amber,Romi Rain,Stormy Daniels,Steven St. Croix,Chanel Prestor,Mick Blue,Brendon Miller,Jack Vegas,Seth Gamble

This Stormy Daniels action-comedy features the perennial fan favorite as Ivy Diamond, a sultry super criminal who, along with her band of bodacious thieves, sets out to rule the world. Hot on their trail is a cynical Irish cop and his newbie sidekick. With its witty dialogue, dramatic intrigue and six steamy sex scenes, Pretty Dangerous will steal your heart!

